This is a superior Romanian M10-762, 7.62x39 caliber, 18" bbl, blue in 95% condition or better.  Equipped with M&M Quad-Rail front handguard, Mag-pul angle grip and rail covers.  Item G-38854-1

Description:

The rifle you see above is a Romanian M10-AK variant imported directly from Romania. The M10 AK-type rifles are entirely manufactured of all NEW parts.

The barrels of these rifles are cold hammer forged and chrome-lined for long lasting durability and increased accuracy and have a 1:10 twist rate with four lands and grooves; windage adjustable RPK-style rear sights graduated to 1000 meters in 100 meter increments, adjustable; iron front sight.

SPECIFICATIONS: 
Overall Length: 36"; 
Barrel: NEW Chrome-lined, 16.25" long, 1:10 twist rate with four lands and grooves, right hand twist, ; 
Weight, Unloaded w/out Bayonet: 6 lbs; 
Action Type: Semi-automatic; 
Caliber: 7.62x39mm; 
Magazine: 30 round, double stack; 
Rear Sight Type: RPK type sight graduated to 1000 meters in 100 meter increments. 

We have additional higher resolution pictures of this item available upon request.

Call or come by Green Country Arms & Pawn in Tulsa, OK, (9075 E 31st St, Tulsa, OK). Be sure to mention that you saw our ad on Armslist.

We can also ship to a FFL dealer. Shipping is $20 for all hand guns and $40 for long guns in the lower 48 states. We do NOT ship to CA. We will ship to NY, CO, CT or any other state within the restrictions of those states. If you have a question, please ask. Payment can be made using a credit card (NO Am. Ex.), by phone or with postal money order (upon clearing). We are currently not accepting personal checks. 

You can also come check out our guns, ammo and accessories in person at our store M-F 9am - 6pm, Sat 10am - 5pm. We're closed on Sundays.

We also buy and trade firearms.  We now have a searchable Real-Time firearms inventory database at www.greencountryarms.com/Firearms.  Check out some of our other guns.
